import React from 'react';
import HeaderBar from './components/HeaderBar.js';
import { BrowserRouter as Router, Route } from 'react-router-dom';
//import './css/bootstrap.css';



function App() {
  return (
    <div> 
    <Router>

      <HeaderBar></HeaderBar>

      <Route exact={true} path="/dashboard" render={() => (
        <div>Hy Bro</div>

      )} />     



      </Router>
    </div>
  );
}

export default App;
